window.bookSummaryJSON = "<p>Rich in suspense and brimming with adventure, the New York Times-bestselling Underland Chronicles unfold the fate of the Underland and the great warrior, Gregor. Suzanne Collins is also the author of the bestselling Hunger Games trilogy. </p> <p>When Gregor falls through a grate in the laundry room of his apartment building, he hurtles into the dark Underland, where spiders, rats, and cockroaches coexist uneasily with humans. This world is on the brink of war, and Gregor's arrival is no accident. A prophecy foretells that Gregor has a role to play in the Underland's uncertain future. Gregor wants no part of it, until he realizes it's the only way to solve the mystery of his father's disappearance. Reluctantly, Gregor embarks on a dangerous adventure that will change both him and the Underland forever.</p>"; 
